Novodmitriyevka (; , Şobıtlı) is a rural locality (a selo) in Tarumovsky District, Republic of Dagestan, Russia. Population:  There are 18 streets.
Geography
Novodmitriyevka is located 7&nbsp;km west of Tarumovka (the district's administrative centre) by road. Tarumovka is the nearest rural locality.
